[TextBlock(text='[
  {
    "sid": "50094",
    "Technique ID": "T1036",
    "Technique name": "Masquerading",
    "Quotes": [
      "Adversaries may attempt to manipulate features of their artifacts to make them appear legitimate or benign to users and/or security tools"
    ],
    "Explanation": "The Snort rule is designed to detect an HTTP attack attempt where the attacker tries to masquerade as a legitimate image file by using the 'file://' protocol handler to load a remote image from a malicious server. This technique is used by adversaries to make their malicious content appear benign to evade detection."
  },
  {
    "sid": "50094",
    "Technique ID": "T1659",
    "Technique name": "Content Injection",
    "Quotes": [
      "Adversaries may gain access and continuously communicate with victims by injecting malicious content into systems through online network traffic"
    ],
    "Explanation": "The Snort rule is designed to detect an attempt to inject malicious content (an image tag with a remote source) into an HTTP response, which is a form of content injection. This technique is used by adversaries to gain access and maintain communication with the victim's system."
  }
]', type='text')][TextBlock(text='[
