[TextBlock(text='[
  {
    "sid": "27967",
    "Technique ID": "T1505",
    "Technique name": "Server Software Component",
    "Quotes": [
      "Adversaries may abuse legitimate extensible development features of servers to establish persistent access to systems"
    ],
    "Explanation": "The Snort rule is designed to detect the Chopper web shell, which is a malicious server software component that allows an attacker to gain persistent access to a compromised system."
  },
  {
    "sid": "27967", 
    "Technique ID": "T1071",
    "Technique name": "Application Layer Protocol",
    "Quotes": [
      "Adversaries may communicate using OSI application layer protocols to avoid detection/network filtering by blending in with existing traffic"
    ],
    "Explanation": "The Snort rule is looking for HTTP traffic, which is an application layer protocol, and the Chopper web shell uses HTTP to communicate with the attacker's command and control server, blending in with normal web traffic."
  }
]', type='text')][TextBlock(text='[
