[TextBlock(text='[
  {
    "sid": "10096",
    "Technique ID": "T1056",
    "Technique Name": "Input Capture",
    "Quotes": [
      "Adversaries may use methods of capturing user input to obtain credentials or collect information"
    ],
    "Explanation": "The Snort rule is designed to detect a keylogger malware, which captures user input (keystrokes) to steal credentials or other sensitive information, aligning with the Input Capture technique."
  },
  {
    "sid": "10096", 
    "Technique ID": "T1115",
    "Technique Name": "Clipboard Data",
    "Quotes": [
      "Adversaries may collect data stored in the clipboard from users copying information within or between applications"
    ],
    "Explanation": "While the Snort rule specifically targets a keylogger, some keyloggers may also capture clipboard data, making the Clipboard Data technique relevant."
  }
]', type='text')][TextBlock(text='[
  {
