[TextBlock(text='[
  {
    "sid": "50106",
    "Technique ID": "T1557",
    "Technique name": "Adversary-in-the-Middle",
    "Quotes": [
      "Adversaries may attempt to position themselves between two or more networked devices using an adversary-in-the-middle (AiTM) technique to support follow-on behaviors such as Network Sniffing, Transmitted Data Manipulation, or replay attacks (Exploitation for Credential Access)"
    ],
    "Explanation": "The Snort rule is designed to detect a Responder poisoner SMB attack attempt, which is a type of Adversary-in-the-Middle (AiTM) attack. The rule looks for specific content in the network traffic that indicates an attempt to position the attacker between the client and server to potentially conduct follow-on activities like credential theft or data manipulation."
  },
  {
    "sid": "50106",
    "Technique ID": "T1040",
    "Technique name": "Network Sniffing",
    "Quotes": [
      "Adversaries may sniff network traffic to capture information about an environment, including authentication material passed over the network"
    ],
    "Explanation": "The Responder poisoner SMB attack detected by the Snort rule could potentially be used by an adversary to conduct Network Sniffing. By positioning themselves as a Man-in-the-Middle, the attacker could sniff network traffic and capture sensitive information like authentication credentials."
  }
]', type='text')][TextBlock(text='[
