[TextBlock(text='[
  {
    "sid": "50466",
    "Technique ID": "T1557",
    "Technique name": "Adversary-in-the-Middle",
    "Quotes": [
      "Adversaries may attempt to position themselves between two or more networked devices using an adversary-in-the-middle (AiTM) technique to support follow-on behaviors such as Network Sniffing, Transmitted Data Manipulation, or replay attacks (Exploitation for Credential Access)"
    ],
    "Explanation": "The Snort rule detects an SMB negotiation attack attempt, which is a type of adversary-in-the-middle attack where the attacker positions themselves between the client and server to intercept and manipulate network traffic."
