[TextBlock(text='[
  {
    "sid": "31070",
    "Technique ID": "T1014",
    "Technique name": "Rootkit",
    "Quotes": [
      "Adversaries may use rootkits to hide the presence of programs, files, network connections, services, drivers, and other system components"
    ],
    "Explanation": "The Snort rule specifically mentions 'Win.Rootkit.Necurs' in the message field, indicating that it is designed to detect a rootkit malware called Necurs. This directly maps to the 'Rootkit' technique from MITRE ATT&CK, which describes how adversaries use rootkits to hide their presence on a compromised system."
