    ],
    "Explanation": "The Snort rule is designed to detect potential attempts to exploit the OpenSSL Heartbleed vulnerability, which affects Internet-facing systems running vulnerable versions of OpenSSL. This aligns with the technique of exploiting public-facing applications to gain initial access to a network."
  },
  {
    "sid": "30780", 
    "Technique ID": "T1211",
