[TextBlock(text='[
  {
    "sid": "30003",
    "Technique ID": "T1189",
    "Technique name": "Drive-by Compromise",
    "Quotes": [
      "Adversaries may gain access to a system through a user visiting a website over the normal course of browsing"
    ],
    "Explanation": "The Snort rule is designed to detect a drive-by compromise attempt, where a user's system is compromised by visiting a malicious website that delivers an exploit kit payload. The rule looks for a specific pattern in the HTTP URI and headers that is indicative of an exploit kit payload download attempt, which aligns with the T1189 Drive-by Compromise technique."
