[TextBlock(text='[
  {
    "sid": "2044",
    "Technique ID": "T1572",
    "Technique name": "Protocol Tunneling",
    "Quotes": [
      "Adversaries may tunnel network communications to and from a victim system within a separate protocol to avoid detection/network filtering and/or enable access to otherwise unreachable systems"
    ],
    "Explanation": "The Snort rule is designed to detect attempts to establish a PPTP (Point-to-Point Tunneling Protocol) connection, which is a form of protocol tunneling used to create a secure tunnel over an insecure network. This technique can be used by adversaries to bypass network security controls and gain access to systems that would otherwise be unreachable."
  },
  {
    "sid": "2044",
    "Technique ID": "T1133",
    "Technique name": "External Remote Services",
    "Quotes": [
      "Adversaries may leverage external-facing remote services to initially access and/or persist within a network"
    ],
    "Explanation": "The Snort rule is specifically looking for PPTP connection attempts from external networks to the internal network. PPTP is a remote access protocol that can be used by adversaries to gain initial access to a network by exploiting vulnerabilities or using stolen credentials."
  }
]', type='text')][TextBlock(text='[
